sys_script_include.script:
var InitializationServiceUtils = Class.create();
InitializationServiceUtils.prototype = {
    initialize: function() {
    },

	/**
     * Get the value from the 'default' attribute in an object
     * 
     * @param {Object} obj - Map of data as an object
     * @returns {string} - The value from the 'default' attribute in the object
     **/
	getParamDefaultValue(obj){
		if (!obj.hasOwnProperty('default')){
			return null;
		}
		return obj.default.toString();
	},
    type: 'InitializationServiceUtils'
};
